import { ArrowRightAltOutlined } from "@material-ui/icons";
import React from "react";
import styled from "styled-components";

const StudentAnnouncement = () => {
  return (
    <Container>
      <Left>
        <Title>Continuously build your skilsls with</Title>
        <Title>Moringa Hackerank</Title>
        <Description>
          Whether you want to improve your problem solving skills, master a new
          skill, or build expertise in the mission-critical topics you need for
          career advancement, Moringa hackerank helps you secure your career.
        </Description>
      </Left>
      <Right>
        <LinkContainer>
          <Link>
            Try Now <ArrowRightAltOutlined />
          </Link>
        </LinkContainer>
      </Right>
    </Container>
  );
};

export default StudentAnnouncement;

const Container = styled.main`
  display: flex;
  padding: 3.75rem;
  display: flex;
  align-items: center;
  color: #101f3c;
`;

const Left = styled.section`
  flex: 1;
`;

const Title = styled.h1`
  font-weight: bold;
  font-size: 3.5rem;
  letter-spacing: 1px;
  margin-bottom: 1rem;
  color: #ea501a;
`;

const Description = styled.p`
  font-size: 1.3rem;
  line-height: 1.5;
`;

const Right = styled.section`
  flex: 1;
`;

const LinkContainer = styled.article``;

const Link = styled.span`
  font-size: 0.875rem;
  border-bottom: 1px solid gray;
  width: max-content;
`;
